import unittest
from unittest.mock import patch
from xml.etree.ElementTree import ParseError

import numpy as np
from ardc_nrt.lib.bom.wfs import bomWFS
from pandas import Timestamp


def mock_wfs_good_res():
    return bom_wfs_good_output

def mock_wfs_bad_res():
    return b'bad xml output'


class TestBomWfs(unittest.TestCase):

    @patch("ardc_nrt.lib.bom.wfs.bomWFS.wfs_query", side_effect=mock_wfs_good_res)
    def test_get_sources_id_metadata(self, mock_wfs):
        bom = bomWFS()
        df = bom.get_sources_id_metadata()

        self.assertEqual(29, len(df.source_id))
        self.assertEqual(52121, df.source_id[0])
        self.assertEqual(-12.68, df.lat[0])
        self.assertEqual(141.68, df.lon[0])

    @patch("ardc_nrt.lib.bom.wfs.bomWFS.wfs_query", side_effect=mock_wfs_good_res)
    def test_get_source_id_metadata(self, mock_wfs):
        bom = bomWFS()
        df = bom.get_source_id_metadata(52121)

        self.assertEqual(52121, df.source_id[0])
        self.assertEqual(-12.68, df.lat[0])
        self.assertEqual(141.68, df.lon[0])

    @patch("ardc_nrt.lib.bom.wfs.bomWFS.wfs_query", side_effect=mock_wfs_good_res)
    def test_get_source_id_data(self, mock_wfs):
        bom = bomWFS()
        df = bom.get_source_id_data(52121)

        self.assertEqual(129, round(np.mean(df.dom_wav_dir)))
        self.assertEqual(Timestamp('2022-03-14 16:00:00+0000', tz='UTC'), df.timestamp[0])

    @patch("ardc_nrt.lib.bom.wfs.bomWFS.wfs_query", side_effect=mock_wfs_bad_res)
    def test_bad_xml_output(self, mock_wfs):
        bom = bomWFS()
        with self.assertRaises(ParseError):
            bom.get_sources_id_metadata()


if __name__ == '__main__':
    unittest.main()
